                                                                    <div class="accordion-item">
                                                                        <div class="accordion-item-content">
                                                                            <div class="accordion-item-title">
                                                                                <div class="accordion-item-title-wrapper">
                                                                                    <div class="icon-container">
                                                                                        <i class="uci-plus-2"></i>
                                                                                    </div>
                                                                                    <div class="title-container">
                                                                                        What is the “System” bet? How is it calculated and how much is the minimum sum of each bet?
                                                                                    </div>
                                                                                </div>
                                                                            </div>
                                                                            <div class="accordion-item-description">
                                                                                <div class="description-container">
                                                                                    <p>“System” is a bet which consists of at least three events. The program forms variants of the events you have selected. For example, if you select a 2/5 system, it means that at least 2 events from 5 must win for the bet to win. The minimum sum of each bet depends on the selection of the system.</p>
                                                                                </div>
                                                                            </div>
                                                                        </div>
                                                                        <div class="clearfix"></div>
                                                                    </div>
                                                                    <div class="accordion-item">
                                                                        <div class="accordion-item-content">
                                                                            <div class="accordion-item-title">
                                                                                <div class="accordion-item-title-wrapper">
                                                                                    <div class="icon-container">
                                                                                        <i class="uci-plus-2"></i>
                                                                                    </div>
                                                                                    <div class="title-container">
                                                                                        What is a “Handicap”?
                                                                                    </div>
                                                                                </div>
                                                                            </div>
                                                                            <div class="accordion-item-description">
                                                                                <div class="description-container">
                                                                                    <p>A handicap is a head start given to a selection expressed in goals/points/sets/frames etc. depending on the type of the competition. The handicap is offered by the bookmaking company and it can be “positive” (1), “negative” (-1) and “zero”. For example, if you made a bet on “Handicap 1(2)” on a football match, this means you allowed Team 1 a 2 - goal ‘head start’.</p>
                                                                                    <p>&nbsp;</p>
                                                                                    <ul>
                                                                                        <li>If the match ends 1-1, then adding the handicap will produce a score of 3-1 and the bet will win.</li>
                                                                                        <li>If the match ends 0-3, then adding the handicap will produce a score of 2-3 and the bet will lose.</li>
                                                                                        <li>If the match ends 0-2, then adding the handicap will produce a score of 2-2 and the bet will result in a push (stakes returned).</li>
                                                                                        <li>If the handicap is “negative”, you need to subtract rather than add.</li>
                                                                                    </ul>
                                                                                    <p>&nbsp;</p>
                                                                                    <p><strong>Here are a few other examples of a handicap:</strong></p>
                                                                                    <ul>
                                                                                        <li>Bet W1 Handicap (-1) can win only when the home team wins the match by two goals.</li>
                                                                                        <li>Bet W2 Handicap (1) can win only when the away team does not lose the match (draw or victory of the away team).</li>
                                                                                        <li>Bet X Handicap (1) can win only when the home team wins the match by one goal (or when the away team loses by one goal).</li>
                                                                                        <li>Bet X Handicap (-1) can win only when the home team loses the match by one goal (if the away team wins by one goal).</li>
                                                                                        <li>Bet W1 Handicap (-2) can win only when the home team wins the match by three goals. Bet W2 Handicap (2) can win only in the following result of the match:<br>A draw<br>The victory of the home team by one goal</li>
                                                                                    </ul>
                                                                                    <p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Any victory by the away team.</p>
                                                                                    <ul>
                                                                                        <li>Bet X Handicap (2) can win only when the home team wins by two goals.</li>
                                                                                        <li>Bet X Handicap (-2) can win only when the home team loses by two goals (or the away team wins by two goals).</li>
                                                                                    </ul>
                                                                                </div>
                                                                            </div>
                                                                        </div>
                                                                        <div class="clearfix"></div>
                                                                    </div>
                                                                    <div class="accordion-item">
                                                                        <div class="accordion-item-content">
                                                                            <div class="accordion-item-title">
                                                                                <div class="accordion-item-title-wrapper">
                                                                                    <div class="icon-container">
                                                                                        <i class="uci-plus-2"></i>
                                                                                    </div>
                                                                                    <div class="title-container">
                                                                                        What is a “Hattrick”?
                                                                                    </div>
                                                                                </div>
                                                                            </div>
                                                                            <div class="accordion-item-description">
                                                                                <div class="description-container">
                                                                                    <p>A “Hattrick” bet means that one of the players of the two teams should score three or more goals during the match.</p>
                                                                                </div>
                                                                            </div>
                                                                        </div>
                                                                        <div class="clearfix"></div>
                                                                    </div>
                                                                    <div class="accordion-item">
                                                                        <div class="accordion-item-content">
                                                                            <div class="accordion-item-title">
                                                                                <div class="accordion-item-title-wrapper">
                                                                                    <div class="icon-container">
                                                                                        <i class="uci-plus-2"></i>
                                                                                    </div>
                                                                                    <div class="title-container">
                                                                                        What do W1/W2, W1/X, X/W2 and other bets mean?
                                                                                    </div>
                                                                                </div>
                                                                            </div>
                                                                            <div class="accordion-item-description">
                                                                                <div class="description-container">
                                                                                    <p>This type of bet is halftime/fulltime betting, the first symbol shows the result of the first half, and the second symbol shows the result of the game. For example, W1/W2 bet means that the first team has won in the first half but the second team has won in the total game. W1/X bet means that the first team has won in the first half, and the overall game has ended in a draw.</p>
                                                                                </div>
                                                                            </div>
                                                                        </div>
                                                                        <div class="clearfix"></div>
                                                                    </div>
                                                                    <div class="accordion-item">
                                                                        <div class="accordion-item-content">
                                                                            <div class="accordion-item-title">
                                                                                <div class="accordion-item-title-wrapper">
                                                                                    <div class="icon-container">
